webpackJsonp([0xe078ef8d34e3],{402:function(t,e){t.exports={data:{site:{siteMetadata:{rootURL:"https://naoty.github.io"}},markdownRemark:{frontmatter:{title:"CourseraのMachine Learningを受講しはじめた",time:"2018-05-01T21:47:00+0900",description:null},html:'<p>5月から<a href="https://www.coursera.org/learn/machine-learning">CourseraのMachile Learning</a>を受講しはじめた。</p>\n<p>正月からちょっとずつ機械学習の勉強をしているけど、それは40代以降もプログラマーとして働き続けたいと思っているからだ。あと10年くらいは今の知識や経験で活躍できるかもしれないけど、ずっとプログラマーでいるには新しい技術領域に時間をかけたいと思った。まずはCoursera等で勉強し、少しずつ仕事として機械学習に取り組んでいけるようにしたい。</p>',fileAbsolutePath:"contents/posts/29.md"}},pathContext:{id:"contents/posts/29.md absPath of file >>> MarkdownRemark"}}}});
